export default async function RequisitionFood(food) {
  const url = `https://www.themealdb.com/api/json/v1/1/filter.php?i=${food}`;
  const responseApi = await fetch(url)
    .then((parameter) => parameter.json());
  return responseApi.meals;
}

export async function RequisitionFoodName(food) {
  const url = `https://www.themealdb.com/api/json/v1/1/searc.php?s=${food}`;
  const responseApi = await fetch(url)
    .then((parameter) => parameter.json());
  return responseApi.meals;
}

export async function RequisitionFoodFirstName(food) {
  const url = `https://www.themealdb.com/api/json/v1/1/search.php?f=${food}`;
